const witcat_sensory_control_picture = "data:image/svg+xml;base64,";

const witcat_sensory_control_icon = "data:image/svg+xml;base64,";

// eslint-disable-next-line camelcase
const witcat_sensory_control_extensionId = 'WitCatSensoryControl';

/** @typedef {string|number} SCarg 来自Scratch圆形框的参数，虽然这个框可能只能输入数字，但是可以放入变量，因此有可能获得数字和文本，需要同时处理 */

class WitCatSensoryControl {
	constructor(runtime) {
		/**
		 * 获取的手机角度信息
		 */
		this.Gyroscope = {};

		this._latestDeviceMotionEvent = null;

		this.runtime = runtime;

		/**
		 * Scratch 所使用的 canvas，获取不到返回 null
		 * @return {HTMLCanvasElement | null}
		 */
		this.canvas = () => {
			try {
				const { canvas } = this.runtime.renderer;
				if (canvas instanceof HTMLCanvasElement) {
					return canvas.parentElement;
				}
				return null;
			} catch (err) {
				return null;
			}
		};

		this.canvasSelf = () => {
			try {
				const { canvas } = this.runtime.renderer;
				if (canvas instanceof HTMLCanvasElement) {
					return canvas;
				}
				return null;
			} catch (err) {
				return null;
			}
		};

		if (this.canvas() === null) {
			console.error('当前页面不支持多指触控/全屏，请前往作品详情页体验完整作品！');
			// 注意：在提示之后，扩展仍然在运行。需要在后面引用 Canvas 的部分进行判断。
		}
		this._addevent();

		this._formatMessage = runtime.getFormatMessage({
			'zh-cn': {
				'WitCatSensoryControl.name': '白猫的体感控制',
				'WitCatSensoryControl.docs': '📖拓展教程',
				'WitCatSensoryControl.gyroscope': '当前[p]轴角度',
				'WitCatSensoryControl.acceleration': '当前[p]方向加速度',
				'WitCatSensoryControl.Gacceleration': '当前[p]方向重力加速度',
				'WitCatSensoryControl.way.1': 'X',
				'WitCatSensoryControl.way.2': 'Y',
				'WitCatSensoryControl.way.3': 'Z',
			},
			en: {
				'WitCatSensoryControl.name': 'WitCat’s Sensory Control',
				'WitCatSensoryControl.docs': '📖Tutorials',
				'WitCatSensoryControl.gyroscope': 'Current [p] axis Angle',
				'WitCatSensoryControl.acceleration': 'Current [p] direction acceleration',
				'WitCatSensoryControl.Gacceleration': 'Acceleration of gravity in current [p] direction',
				'WitCatSensoryControl.way.1': 'X',
				'WitCatSensoryControl.way.2': 'Y',
				'WitCatSensoryControl.way.3': 'Z',
			},
		});
	}

	/**
	 * 翻译
	 * @param {string} id
	 * @returns {string}
	 */
	formatMessage(id) {
		return this._formatMessage({
			id,
			default: id,
			description: id,
		});
	}

	getInfo() {
		return {
			id: witcat_sensory_control_extensionId, // 拓展id
			name: this.formatMessage('WitCatSensoryControl.name'), // 拓展名
			blockIconURI: witcat_sensory_control_icon,
			menuIconURI: witcat_sensory_control_icon,
			color1: '#FCB103',
			color2: '#9e8f37',
			blocks: [
				{
					opcode: 'gyroscope',
					blockType: 'reporter',
					text: this.formatMessage('WitCatSensoryControl.gyroscope'),
					arguments: {
						p: {
							type: 'string',
							menu: 'rot',
						},
					},
				},
				{
					opcode: 'acceleration',
					blockType: 'reporter',
					text: this.formatMessage('WitCatSensoryControl.acceleration'),
					arguments: {
						p: {
							type: 'string',
							menu: 'rot',
						},
					},
				},
				{
					opcode: 'Gacceleration',
					blockType: 'reporter',
					text: this.formatMessage('WitCatSensoryControl.Gacceleration'),
					arguments: {
						p: {
							type: 'string',
							menu: 'rot',
						},
					},
				},
			],
			menus: {
				rot: [
					{
						text: this.formatMessage('WitCatSensoryControl.way.1'),
						value: 'x',
					},
					{
						text: this.formatMessage('WitCatSensoryControl.way.2'),
						value: 'y',
					},
					{
						text: this.formatMessage('WitCatSensoryControl.way.3'),
						value: 'z',
					},
				],
			},
		};
	}

	/**
	 * 获取移动端设备角度
	 * @param {JSON} args 
	 */
	gyroscope(args) {
		const event = this.Gyroscope;
		if (!event) return "";

		switch (args.p) {
			case 'x':
				return event.beta;
			case 'y':
				return event.gamma;
			case 'z':
				return event.alpha;
			default:
				return "";
		}
	}

	acceleration(args) {
		const event = this._latestDeviceMotionEvent;
		if (!event || !event.acceleration) return "";

		switch (args.p) {
			case 'x':
				return event.acceleration.x;
			case 'y':
				return event.acceleration.y;
			case 'z':
				return event.acceleration.z;
			default:
				return "";
		}
	}

	Gacceleration(args) {
		const event = this._latestDeviceMotionEvent;
		if (!event || !event.accelerationIncludingGravity) return "";

		switch (args.p) {
			case 'x':
				return event.accelerationIncludingGravity.x;
			case 'y':
				return event.accelerationIncludingGravity.y;
			case 'z':
				return event.accelerationIncludingGravity.z;
			default:
				return "";
		}
	}

	/** 添加事件触发器 */
	_addevent() {
		window.addEventListener('deviceorientation', (e) => {
			this.Gyroscope = e;
		});
		if (window.DeviceMotionEvent) {
			window.addEventListener('devicemotion', (e) => {
				this._latestDeviceMotionEvent = e;
			});
		} else {
			console.error("当前浏览器不支持 DeviceMotionEvent");
		}
	}
}

window.tempExt = {
	Extension: WitCatSensoryControl,
	info: {
		name: "WitCatSensoryControl.name",
		description: "WitCatSensoryControl.descp",
		extensionId: witcat_sensory_control_extensionId,
		iconURL: witcat_sensory_control_picture,
		insetIconURL: witcat_sensory_control_icon,
		featured: true,
		disabled: false,
		collaborator: "白猫 @ CCW"
	},
	l10n: {
		"zh-cn": {
			"WitCatSensoryControl.name": "白猫的体感控制 V1.0",
			"WitCatSensoryControl.descp": "晃动你的手机！"
		},
		en: {
			"WitCatSensoryControl.name": "WitCat’s Sensory control V1.0",
			"WitCatSensoryControl.descp": "Shake your phone!"
		}
	}
};